Param([String]$Restart)

If ($Restart -ne "") {
	Start-Sleep 1
} 


[System.Reflection.Assembly]::LoadWithPartialName('System.Windows.Forms')  	 | out-null
[System.Reflection.Assembly]::LoadWithPartialName('System.Drawing') 		 | out-null
Taskkill /IM ssh.exe /F
$iconBase64 = ""
$iconBytes = [Convert]::FromBase64String($iconBase64)
$stream = [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)

$icon = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))

$proxy_job = $null
$wshell = New-Object -ComObject Wscript.Shell
function Get-Proxy () {
	return Get-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Internet Settings' | Select-Object ProxyServer, ProxyEnable, ProxyOverride   | Format-Table | Out-String  
}
$ProxyFunc = {
	function Start-Proxy { 
		$ssh_job = $null
		$status = 0
		$wshell = New-Object -ComObject Wscript.Shell
		try {
			while ($true) {
				try {
					$x = netstat -ano | findstr "LISTEN" | findstr "9090" 
					#if ((Test-NetConnection -ComputerName '127.0.0.1' -Port 50108).TcpTestSucceeded) {
					if ($null -ne $x) {
						if ($status -eq 0) {
							Set-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Internet Settings' -name ProxyServer -Value "socks=127.0.0.1:9090"
							Set-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Internet Settings' -name ProxyOverride -Value "192.168.*.*;10.*.*.*;172.*.*.*;127.*.*.*;::1"
							Set-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Internet Settings' -name ProxyEnable -Value 1
							$wshell.Popup("Secure Tunnel is running now!!", 5, "Secure Tunnel", 0x0 + 0x20)
							$status = 1
						}
						Start-Sleep 5
					}
					else {
						$status = 0
						$ssh_job = Start-Job -ScriptBlock { 
							ssh -i $env:USERPROFILE\.ssh\id_rsa -D 9090 -q -C -N -f root@165.227.128.109
						}
						$wshell.Popup("Starting The App...", 5, "Secure Tunnel", 0x0 + 0x20);
						Start-Sleep 5
					}
				}
				catch {
					$wshell.Popup("Error 1", 5, "Secure Tunnel", 0x0 + 0x10);
				}
			}
		}
		catch {
			catch {
				$wshell.Popup("Error 2", 5, "Secure Tunnel", 0x0 + 0x10);
			}
		}
		finally {
			$job_name = $ssh_job | Select-Object -Property Name | Select-Object -ExpandProperty "Name"
			Stop-Job -Name $job_name 
			Stop-Proxy
			
		}
			
	}
}


function Stop-Proxy () {   
	$job_name = $proxy_job | Select-Object -Property Name | Select-Object -ExpandProperty "Name"
	write-output "$(Get-Date)(Stop proxy_job $($job_name) $($pid)) $_"
	Stop-Job -Name $job_name 
	Set-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Internet Settings' -name ProxyServer -Value ""
	Set-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Internet Settings' -name ProxyOverride -Value ""
	Set-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Internet Settings' -name ProxyEnable -Value 0
	$wshell.Popup("App Terminated", 5, "Secure Tunnel", 0x0 + 0x10);
	Taskkill /IM ssh.exe /F
	Taskkill /IM SecureTunnel.exe /F
	Stop-Process $pid
}


# Entry point

# ----------------------------------------------------
# tray menu
# ----------------------------------------------------		

$Tray_Icon = New-Object System.Windows.Forms.NotifyIcon
$Tray_Icon.Text = "Secure Tunnel"
$Tray_Icon.Icon = $icon
$Tray_Icon.Visible = $true


$Tray_Restart = New-Object System.Windows.Forms.MenuItem
$Tray_Restart.Text = "Restart"

$Tray_Exit = New-Object System.Windows.Forms.MenuItem
$Tray_Exit.Text = "Exit"


$contextmenu = New-Object System.Windows.Forms.ContextMenu
$Tray_Icon.ContextMenu = $contextmenu
$Tray_Icon.contextMenu.MenuItems.AddRange($Tray_Restart)
$Tray_Icon.contextMenu.MenuItems.AddRange($Tray_Exit)



# Run background app
write-output "$(Get-Date)(App Start $($pid)) $_"
$proxy_job = Start-Job -InitializationScript $ProxyFunc -ScriptBlock { Start-Proxy }

# When Exit is clicked, close everything and kill the PowerShell process
$Tray_Exit.add_Click( {
		$Tray_Icon.Visible = $false
		write-output "$(Get-Date)(Click Exit $($pid))"
		Stop-Proxy
 })

# When Exit is clicked, close everything and restart the PowerShell process
$Tray_Restart.add_Click( {
		$Restart = "Yes"
		start-process -WindowStyle hidden powershell.exe "C:\ProgramData\SecureTunnel\App.ps1 '$Restart'" 	
		$Tray_Icon.Visible = $false
		write-output "$(Get-Date)(Click Restart $($pid))" 
		Stop-Proxy
 })

# No Console
$windowcode = '[DllImport("user32.dll")] public static extern bool ShowWindowAsync(IntPtr hWnd, int nCmdShow);'
$asyncwindow = Add-Type -MemberDefinition $windowcode -name Win32ShowWindowAsync -namespace Win32Functions -PassThru
$null = $asyncwindow::ShowWindowAsync((Get-Process -PID $pid).MainWindowHandle, 0)


# Show tray
$appContext = New-Object System.Windows.Forms.ApplicationContext
[void][System.Windows.Forms.Application]::Run($appContext)